function SearchData() {
    const [SearchItem, setSearchItem] = useState("");

    useEffect(() => {
      commonAxios();
    }, []);
  
    //더 보기에 두 번 들어가기 때문에 따로 분리
    const commonAxios = () => {
      //post에 info값 넣을 것
      axios.post("/api/video/searchvideo").then((response) => {
        if (response.data.success) {
            console.log(response.data.videoInfo)
          // console.log(response.data);
  
        //   if (showMore) {
